import math


def is_perfect_square(x):
    s = int(math.sqrt(x))
    return s*s == x


def is_perfect_power(x):
    if x < 2:
        return False
    for y in range(2, int(math.log2(x)) + 2):
        if is_perfect_square(x**(1./y)):
            return True
    return False


def find_smallest(n):
    if is_perfect_power(n):
        return n**(1./3)
    else:
        return -1


