    return (x2 - x1) * (y3 - y1) - (y2 - y1) * (x3 - x1) > 0


def intersect(x1, y1, r1, x2, y2, r2):
    d = dist(x1, y1, x2, y2)
    if d > r1 + r2:
        return False
    if d < abs(r1 - r2):
        return False
    if d == 0 and r1 == r2:
        return False
    if d == 0:
        return True
    if d < r1 + r2 and d > abs(r1 - r2):
        return True
    return False


