def pow_mod(a, b):
    if b == 0:
        return 1
    if b % 2 == 0:
        return (pow_mod(a, b // 2) ** 2) % MOD
    return (a * pow_mod(a, b - 1)) % MOD


def inv(a):
    return pow_mod(a, MOD - 2)


def mul(a, b):
    return (a * b) % MOD


def div(a, b):
    return mul(a, inv(b))


