def bfs(s, d, adj):
    q = [s]
    visited = set()
    visited.add(s)
    steps = 0
    while q:
        n = len(q)
        for i in range(n):
            u = q.pop(0)
            if u == d:
                return steps
            for v in adj[u]:
                if v not in visited:
                    q.append(v)
                    visited.add(v)
        steps += 1
    return -1


def dfs(s, d, adj, visited):
    if s == d:
        return True
    visited.add(s)
    for v in adj[s]:
        if v not in visited:
            if dfs(v, d, adj, visited):
                return True
    return False


