MOD = 1000000007


def power(a, b):
    if b == 0:
        return 1
    if b % 2 == 0:
        return power(a*a, b//2) % MOD
    else:
        return a*power(a*a, b//2) % MOD


def inv(a):
    return power(a, MOD-2)


def div(a, b):
    return (a*inv(b)) % MOD


def fact(n):
    if n == 0:
        return 1
    return (n*fact(n-1)) % MOD


def C(n, r):
    return (fact(n) * inv(fact(r)) * inv(fact(n-r))) % MOD


