def sieve(n):
    primes = [True for i in range(n+1)]
    p = 2
    while (p * p <= n):
        if (primes[p] == True):
            for i in range(p * p, n+1, p):
                primes[i] = False
        p += 1
    primes[0] = False
    primes[1] = False
    return primes


def solve(n, k):
    primes = sieve(n)
    ans = 0
    for i in range(2, n+1):
        if primes[i]:
            ans += 1
            if ans == k:
                return i


